import { Link } from "react-router-dom";

const Products = () => {
    return (
        <section>
            <h1>This is Product</h1>
            <ul>
                <Link to='/products/p1'>Book</Link>
                <Link to='/products/p2'>A Carpet</Link>
                <Link to='/products/p3'>An Online Course</Link>
            </ul>
        </section>
    );
};
export default Products;
